CREATE PROCEDURE [dbo].[spMatchupEntry_GetByMatchup]
	@param1 int = 0,
	@param2 int
AS

BEGIN

	SET NOCOUNT ON;
	insert into dbo.Person (FirstName, LastName, EmailAddress, CellphoneNumber)
	values (@FirstName, @LastName, @EmailAddress, @CellphoneNumber)

	select @Id = SCOPE_IDENTITY();

END

CREATE PROCEDURE [dbo].[spPerson_Insert]
	@FirstName nvarchar(50),
	@LastName nvarchar(50),
	@EmailAddress nvarchar(200),
	@CellphoneNumber nvarchar(20),
	@Id int = 0 output

AS

begin SET NOCOUNT ON;
select p.* from dbo.Prize p inner join dbo.TournamentPrize t on p.Id = t.PrizeId where t.TournamentId = @TournamentId;
end

